import React from 'react';
import logo from '../assets/logo.png';
import logo1 from '../assets/img.PNG';
//import Interface2 from './Interface2';//
import { useNavigate } from 'react-router-dom';



function Interface1({ onNavigate }) {
  const navigate = useNavigate();

  const goToInterface2 = (value) => {
    navigate('/Interface2', { state: { selectedValue: value } });  // Navigue vers l'interface 2 avec un état
  };

  return (
    <div> {/* Conteneur parent pour encapsuler tout le JSX */}
      <div className="header">
        <NavBar />
      </div>
      <div className="survey-content">
        <h1>Combien d'appareils dans votre maison se connectent à Internet?</h1>
        <p>(Ordinateurs, smartphones, tablettes, consoles de jeu, téléviseurs intelligents, appareils domestiques intelligents, etc.)</p>
        <div><img src={logo1} alt="" /></div>
        <div className="survey-options">
          <button className="survey-btn" onClick={() => goToInterface2(5)}>1-3</button>
          <button className="survey-btn" onClick={() => goToInterface2(10)}>4-7</button>
          <button className="survey-btn" onClick={() => goToInterface2(15)}>8-10</button>
          <button className="survey-btn" onClick={() => goToInterface2(20)}>10+</button>
        </div>
      </div>
    </div>
  );
}



function NavBar() {
    return (
        <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', backgroundColor: '#333', color: '#fff', padding: '10px' }}>
            <img src={logo} alt="" style={{ height: '40px' }} />
      <div style={{ fontSize: '20px' }}></div>
        </div>
    );
}


  

export default Interface1;
